æ $userName —Å–≤–µ—Å–Ω–æ –∑–Ω–∞.\n8) –ë–ª–∏–∂–∞ –±—É–¥—É—õ–Ω–æ—Å—Ç ‚Äî $hiddenCard (45-55 —Ä–µ—á–∏): –≤–µ—Ä–æ–≤–∞—Ç–Ω–∏ —Ä–∞–∑–≤–æ—ò —É –Ω–∞—Ä–µ–¥–Ω–∏–º –Ω–µ–¥–µ—ô–∞–º–∞.\n9) –£–Ω—É—Ç—Ä–∞—à—ö–µ —ò–∞ ‚Äî $selfCard (45-55 —Ä–µ—á–∏): —Å—Ç–∞—ö–µ, —Ä–µ—Å—É—Ä—Å–∏ $userName.\n10) –û–∫—Ä—É–∂–µ—ö–µ ‚Äî $environmentCard (45-55 —Ä–µ—á–∏): —É—Ç–∏—Ü–∞—ò —ô—É–¥–∏ –∏ –æ–∫–æ–ª–Ω–æ—Å—Ç–∏.\n11) –ù–µ–¥–µ—ô–µ / —Å—Ç—Ä–∞—Ö–æ–≤–∏ ‚Äî $hopesCard (45-55 —Ä–µ—á–∏): –æ—á–µ–∫–∏–≤–∞—ö–∞ –∏–ª–∏ —Å—Ç—Ä–∞—Ö–æ–≤–∏ $userName.\n12) –ò—Å—Ö–æ–¥ ‚Äî $outcomeCard (45-55 —Ä–µ—á–∏): –≤–µ—Ä–æ–≤–∞—Ç–∞–Ω —Ä–µ–∑—É–ª—Ç–∞—Ç —É–∑–∏–º–∞—ò—É—õ–∏ —É –æ–±–∑–∏—Ä —Å–∞–≤–µ—Ç —Ä–∞—Å–ø–ª–µ—Ç–∞.\n13) –ó–∞–∫—ô—É—á–∞–∫: –ø—Ä–∏—ò–∞—Ç–µ—ô—Å–∫–∞ –ø–æ–¥—Ä—à–∫–∞ –∏ –ø–æ–∑–∏—Ç–∏–≤–Ω–∞ –∞—Ñ–∏—Ä–º–∞—Ü–∏—ò–∞ (30-35 —Ä–µ—á–∏) –∑–∞ $userName.\n–ü–æ—Ç—Ä–µ–±–Ω–æ: —É–∫—É–ø–Ω–æ 400-500 —Ä–µ—á–∏, –∂–∏–≤–∏ —Ä–∞–∑–≥–æ–≤–æ—Äni —Ç–æ–Ω, 4-6 –µ–∑–æ—Ç–µ—Ä–∏—á–Ω–∏—Ö –µ–º–æ—Ç–∏–∫–æ–Ω–∞; —Å–≤–∞–∫–∏ –±–ª–æ–∫ –æ–¥–≤–æ—ò–∏—Ç–∏ –¥–≤–æ—Å—Ç—Ä—É–∫–∏–º –Ω–æ–≤–∏–º —Ä–µ–¥–æ–º.\n–ù–µ –∫–æ—Ä–∏—Å—Ç–∏ *, # –∏–ª–∏ –¥—Ä—É–≥—É —Ä–∞–∑–º–µ—Ç–∫—É; –ø–∏—à–∏ —Å–∞–º–æ –æ–±–∏—á–Ω–∏–º —Ç–µ–∫—Å—Ç–æ–º.';
